import React, {useState} from 'react'
//css
import './Field.css'
//componenets
import Checkbox from '../Checkbox/Checkbox'


export default function Field(props) {
    const [toggle, setToggle] = useState(false);

    const changeToggle = () => {
      setToggle(!toggle);
    }

    return (
        <div className="Field">
            {props.stats.map((stat) => {
                return <Checkbox toggle={toggle} changeToggle={props.changeToggle} value={stat} key={stat}/>
            })}
        </div>

    )
}
